import React,{Component} from 'react'
import Photo1 from './Photos/GoodFork1.jpeg'
import Photo2 from './Photos/GoodFork2.jpg'
import Display from './Display.js'
import Page from './Page.js'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

class Home extends Component{
    render(){

        const photos = [
            {photo:Photo1,
             text:"The Good Fork",
             url:"/the_good_fork"
            },
            {photo:Photo2,
             text:"Heuvos Rancherritos",
             url:"/food"
            },
            {photo:Photo1,
                text:"The Good Fork",
                url:"/me"
               },
               {photo:Photo2,
                text:"Heuvos Rancherritos",
                url:"/this"
               },
               {photo:Photo1,
             text:"The Good Fork",
             url:"/here"
            },
            {photo:Photo2,
             text:"Heuvos Rancherritos",
             url:"/foodie"
            },
            {photo:Photo1,
                text:"The Good Fork",
                url:"/life"
               },
               {photo:Photo2,
                text:"Heuvos Rancherritos",
                url:"/damn"
               },

        ]

        return(
            <Router>
            <div class="row">

                {photos.map((e,i) =>
                        <Display 
                        photo={e.photo}
                        name={e.text}
                        key={i}
                        url={e.url}
                        />
                    )}

            </div>
            </Router>
        )
    }
}

export default Home
